import React, { useState } from "react";
import { useStyles } from "./styles/ProfileStyles";
import { Grid, Divider, Typography } from "@material-ui/core";
import { useSelector } from "react-redux";
import EditIcon from "@material-ui/icons/Edit";

const Profile = () => {
	const classes = useStyles();
	const user = useSelector((state) => state.user);

	const [editting, setEditting] = useState(false);

	return (
		<div className={classes.root}>
			<Grid
				container
				cols={1}
				spacing={10}
				justify="space-around"
				className={classes.gridContainer}
				alignItems="center"
			>
				<EditIcon className={classes.editIcon} onClick={setEditting(true)} />
				<Grid item cols={1} xs={12} className={classes.gridItem}>
					<div className={classes.profPic}></div>

					<div className={classes.userInfo}>
						<Typography
							variant="h6"
							style={{ textAlign: "center", margin: "20px 0" }}
						>
							{user.username}
						</Typography>
						<Divider style={{ margin: "20px 0" }} />
						<div style={{ display: "flex", justifyContent: "space-between" }}>
							<Typography>NAME</Typography>
							<Typography>
								{user.first_name} {user.last_name}
							</Typography>
						</div>
						{Object.keys(user).map((key) =>
							key !== "username" &&
							key !== "first_name" &&
							key !== "last_name" &&
							key !== "bookmarks" &&
							key !== "api_hash" ? (
								<div
									style={{ display: "flex", justifyContent: "space-between" }}
								>
									{console.log(key)}
									<Typography>{key.toUpperCase().replace("_", " ")}</Typography>
									<Typography>{user[key]}</Typography>
								</div>
							) : null
						)}

						{/* <Typography>Email: {user.email}</Typography>
						<Divider style={{ margin: "20px 0" }} />

						<Typography>Weight: {user.weight}</Typography>
						<Typography>Weight Goal: {user.weight_goal}</Typography>
						<Typography>Calorie Goal: {user.calorie_goal}</Typography> */}
					</div>
				</Grid>

				{/* <Grid item cols={1} md={7} className={classes.gridItem}>
					<Typography>Weight: {user.weight}</Typography>
					<Typography>Weight Goal: {user.weight_goal}</Typography>
					<Typography>Calorie Goal: {user.calorie_goal}</Typography>
				</Grid> */}
			</Grid>
		</div>
	);
};

export default Profile;
